import React from 'react'
import { Notifications,
		 EnhancedEncryption,
		 Category,
		 Settings,Home } from "@material-ui/icons";

export const SideBarData = [
	{
		title: "Home",
		icon: <Home />,
		link: "/home",
	},

	{
		title: "Notifications",
		icon: <Notifications />,
		link: "/home",
	},

	{
		title: "Add products",
		icon: <EnhancedEncryption />,
		link: "/home",
	},

	{
		title: "Manage products",
		icon: <Category />,
		link: "/home",
	},

	{
		title: "Seller Settings",
		icon: <Settings />,
		link: "/home",
	},
]
